import React from 'react';
import { colores } from './../../../../../../../shared/coloresCompartidos';

const LinoParis = (props) => {
    
    let urlSelectedColor = colores(props.color);
    console.log(urlSelectedColor);
    return <image href={urlSelectedColor} x="0" y="0" width="20" height="20" />
}

export default LinoParis;
